import ManagerFooter2 from "../Managerpg2/ManagerFooter2";

var bgColors = {
    "Default": "#81b71a",
    "Blue": "#00B1E1",
    "Cyan": "#",
    "Green": "#8CC152",
    "Red": "#E9573F",
    "Yellow": "#d3d3d3",
};

class Managermain4 extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            i: '5',
        }
    }

    repeatForm = (event) => {
        this.setState({
            i: event.target.value
        });
          return(
          <Form>

              <input type="text"
                     id="question"
