                    <TextArea style={{backgroundColor: bgColors.Yellow}} placeholder='Answers'/>
                </Form>

                <div>
                    <Button style={{ "width" :"20px"}} onClick={this.repeatForm}  content='ADD' icon='add' labelPosition='right' />
